import styled from 'styled-components'

export const LinkListWrapper = styled.div`
  padding-top: 100px;

  width: 100vw;
  min-height: 50vh;

  background: #f0f1f6;
`

export const ListWrapper = styled.ul`
  padding: 0 15%;

  display: flex;
  flex-direction: column-reverse;
`
